','17','Análisis de cambios','El formulario puede analizar los cambios realizado por el cliente y notificarlos.

En la notificación en línea, a los datos enviados en el evento modifcación se incluye un id interno como llave asociativo de los registros, y en cada uno de ellos se agrega una columna indicando el tipo de cambio (A, B o M), la columna se accede como $registro[apex_ei_analisis_fila].

En la notificación por eventos, se lanzan los eventos registro_alta, registro_modificacion o registro_baja con el id y los datos de cada registro como parámetros.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
